import { Box, Icon } from '@mui/material';
import naver_button from './naver_button.svg';
import iconcss from './css/NaverIcon.module.css';

const NaverIcon = () => {
  return (
    <Icon className={iconcss.rooticon}>
      <Box className={iconcss.imgbox} component="img" src={naver_button} />
    </Icon>
  );
};

export default NaverIcon;
